import React from "react";
import Navbar from "./navmenu/Navbar";
import Contact from "./Contact";
import { Typography, Box } from "@material-ui/core";
import { useTheme } from "@material-ui/core/styles";
import { makeStyles } from "@material-ui/core/styles";
import animalImg from "../img/animal.jpg";
import angryCatImg from "../img/angrycat.jpg";
import BlogEntry from "./BlogEntry";

const useStyles = makeStyles((theme) => ({
  middleContainer: {
    width: "70%",
    margin: "auto",
    overflow: "hidden",
  },
}));

const Blogs = () => {
  const classes = useStyles();
  const theme = useTheme();
  return (
    <>
      <Navbar />
      <Box className={classes.middleContainer}>
        <section id="bloglist" class="middle container">
          <h1>these are my blogs</h1>
          <h2 class="thinsubtitle">let's see how this goes</h2>
        </section>
      </Box>
      <Contact />
    </>
  );
};

export default Blogs;
